import React from 'react';
import MiniDrawer from './Components/MiniDrawer';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LiveComponent from './components/LiveComponent';
import  LayoutComponent from './components/LayoutComponent';
import SequenceComponent from './components/SequenceComponent';
import MoreComponent from './components/MoreComponent';
import HelloMessage from './components/HelloMessage';



const App = () => {
  return (
     <Router>
     <div style={{ display: 'flex' }}>
     <MiniDrawer />
       <Switch>
         <Route path="/home" component={HelloMessage} />
         <Route path="/live" component={LiveComponent} />
         <Route path="/layout" component={LayoutComponent} />
         <Route path="/sequence" component={SequenceComponent} />
         <Route path="/more" component={MoreComponent} />
       </Switch>
     </div>
   </Router>
  );
};

export default App;
